ly uses BASH or “Bourne Again Shell”.\n            3. While you have to pay hundred’s of dollars for a new Windows version, you can just go download Linux. There’s no manuals or simple installers for the free version. Although there is quite a learning curve when utilizing the free package. There are some easy automated packages of Linux for low prices.\n          "
